import React from "react";
import withContext from "../withContext";

const User = props => {
    const { user } = props.context
    return(
        <div>
            <div className="title-container">
                <h4 className="page-title">User</h4>
            </div>            
            <h1>User: {user}</h1>
        </div>
    )
}

export default withContext(User)
